text383222.addInnerText('<div id=\"text383222\" aria-live=\"polite\" ><a id=\"text383222anc\" style=\"display:block;height:0px;width:0px;\"></a>\n<table style=\"border-collapse:collapse;top:0px;position:absolute; border-spacing:0; width:100%; height:100%\">\n<tr>\n<td style=\"position: absolute;top:0px;left:0px;box-sizing:border-box;width:100%;vertical-align:top;height:100%;padding:5px\">\n<div style=\'height:100%;width:100%;overflow-y:hidden;overflow-x:hidden;\'>\n\n<ul  style=\"list-style-position:outside;text-align:left;\" >\n<li  class=\"text383222Font3\" data-bltIndnt=\"0\" style=\"line-height:1.284;position:relative;margin-left:16px;margin-top:0px;margin-bottom:0px; list-style-image:url(\'images/text383222CircleBulletFont8.png\'); padding-left:7px;\"><!--{ \ndata-bltIndnt:0\n} --><span class=\"text383222Font2\"  >​</span ><span class=\"text383222Font3\"  >Frequently used DLM-marked forms and publications should be re-marked by originators:\n</span ></li >\n<ul  style=\"list-style-position:outside;text-align:left;\" >\n<li  class=\"text383222Font4\" data-bltIndnt=\"74\" style=\"line-height:1.229;position:relative;margin-left:90px;margin-top:0px;margin-bottom:0px; list-style-image:url(\'images/text383222CircleBulletFont9.png\'); padding-left:7px;\"><!--{ \ndata-bltIndnt:74\n} --><span class=\"text383222Font4\"  >FOUO to OFFICIAL: Sensitive.\n</span ></li >\n<li  class=\"text383222Font3\" data-bltIndnt=\"74\" style=\"line-height:1.229;position:relative;margin-left:90px;margin-top:0px;margin-bottom:0px; list-style-image:url(\'images/text383222CircleBulletFont8.png\'); padding-left:7px;\"><!--{ \ndata-bltIndnt:74\n} --><span class=\"text383222Font3\"  >Sensitive to the appropriate </span ><span class=\"text383222Font5\"  >Information Management Marker</span ><span class=\"text383222Font3\"  >​\n</span ></li >\n</ul >\n<p lang=\"en\"  legLH=\"1.229\" style=\"margin-left:0px;text-indent:0px;line-height:1.229;margin-top:0px;margin-bottom:0px;text-align:left;\" >\n<span class=\"text383222Font3\" style=\"background-color:transparentposition:relative;top:-1px;\" >\n&nbsp;</span ></p >\n<ul  style=\"list-style-position:outside;text-align:left;\" >\n<li  class=\"text383222Font3\" data-bltIndnt=\"0\" style=\"line-height:1.229;position:relative;margin-left:16px;margin-top:0px;margin-bottom:0px; list-style-image:url(\'images/text383222CircleBulletFont8.png\'); padding-left:7px;\"><!--{ \ndata-bltIndnt:0\n} --><span class=\"text383222Font3\"  >DLM-marked records retained for referencing purposes, are </span ><span class=\"text383222Font7\"  >NOT</span ><span class=\"text383222Font3\"  > to be re-marked. They are handled as follows:&nbsp;\n</span ></li >\n<ul  style=\"list-style-position:outside;text-align:left;\" >\n<li  class=\"text383222Font4\" data-bltIndnt=\"74\" style=\"line-height:1.229;position:relative;margin-left:90px;margin-top:0px;margin-bottom:0px; list-style-image:url(\'images/text383222CircleBulletFont9.png\'); padding-left:7px;\"><!--{ \ndata-bltIndnt:74\n} --><span class=\"text383222Font4\"  >FOUO the same way as OFFICIAL: Sensitive.&nbsp;\n</span ></li >\n<li  class=\"text383222Font4\" data-bltIndnt=\"74\" style=\"line-height:1.229;position:relative;margin-left:90px;margin-top:0px;margin-bottom:0px; list-style-image:url(\'images/text383222CircleBulletFont9.png\'); padding-left:7px;\"><!--{ \ndata-bltIndnt:74\n} --><span class=\"text383222Font4\"  >Sensitive information:\n</span ></li >\n</ul >\n<p  legLH=\"1.229\" style=\"margin-left:48px;text-indent:0px;line-height:1.229;margin-top:0px;margin-bottom:0px;text-align:left;\" >\n<span class=\"text383222Font4\" style=\"background-color:transparentposition:relative;top:-1px;\" >\n&nbsp;</span ></p >\n<p  legLH=\"1.229\" style=\"margin-left:48px;text-indent:0px;line-height:1.229;margin-top:0px;margin-bottom:0px;text-align:left;\" >\n<span class=\"text383222Font3\" style=\"position:relative;top:-1px;\" >​\n</span ></p >\n<p  legLH=\"1.229\" style=\"margin-left:96px;text-indent:0px;line-height:1.229;margin-top:0px;margin-bottom:0px;text-align:left;\" >\n<span class=\"text383222Font3\" style=\"background-color:transparentposition:relative;top:-1px;\" >\n&nbsp;</span ></p >\n<ul  style=\"list-style-position:outside;text-align:left;\" >\n<li  class=\"text383222Font3\" data-bltIndnt=\"0\" style=\"line-height:1.229;position:relative;margin-left:16px;margin-top:0px;margin-bottom:0px; list-style-image:url(\'images/text383222CircleBulletFont8.png\'); padding-left:7px;\"><!--{ \ndata-bltIndnt:0\n} --><span class=\"text383222Font3\"  >DLM-marked records that are no longer used, are </span ><span class=\"text383222Font7\"  >NOT</span ><span class=\"text383222Font3\"  > to be re-marked. They should be disposed of appropriately. (eg archived)&nbsp; \n</span ></li >\n</ul >\n</ul >\n</ul >\n\n\n</div></td>\n</tr>\n</table>\n</div>\n');
text383222.build()

rgin-top:0px;margin-bottom:0px;text-align:left;\" >\n<span class=\"text383212Font2\" style=\"background-color:transparentposition:relative;top:-1px;\" >\n&nbsp;</span ></p >\n<ul  style=\"list-style-position:outside;text-align:left;\" >\n<li  class=\"text383212Font2\" data-bltIndnt=\"0\" style=\"line-height:1.229;position:relative;margin-left:16px;margin-top:0px;margin-bottom:0px; list-style-image:url(\'images/text383212CircleBulletFont7.png\'); padding-left:7px;\"><!--{ \ndata-bltIndnt:0\n} --><span class=\"text383212Font2\"  >CONFIDENTIAL records not in use, are </span ><span class=\"text383212Font3\"  >NOT</span ><span class=\"text383212Font2\"  > to be re-classified. They should be disposed of appropriately (eg archived).\n</span ></li >\n</ul >\n\n\n</div></td>\n</tr>\n</table>\n</div>\n');
